import React from 'react';
import * as P from './styled'

function CardPequeno(props) {
    return (
        <P.LittleCardContainer>
            <P.LittleCardImg src={ props.imagem } />
            <P.BigcardInicio>
                <P.BigcardH4>{ props.nome }</P.BigcardH4>
                <p>{ props.descricao }</p>
            </P.BigcardInicio>
        </P.LittleCardContainer>
    )
}

export default CardGrande;
